import './App.css';
import Head from './Head';
import HornaLista from './HornaLista';
import TeloStranky from './TeloStranky';

function App() {
  return (
    <>
      <Head />
      <body>
        <HornaLista />
        <TeloStranky />
      </body>
      <footer class="footer">
        <p>Webové technológie 2022</p>
      </footer>
      <script src="java/main.js"></script>
    </>
  );
}

export default App;
